Plot: The Central Park Effect reveals the extraordinary array of wild birds who grace Manhattan's celebrated patch of green and the equally colorful, full-of-attitude New Yorkers who schedule their lives around the rhythms of migration. Acclaimed author Jonathan Franzen, an idiosyncratic trombone technician, a charming fashion-averse teenager, and a bird-tour leader who's recorded every sighting she's made since the 1940s are among the film's cast of characters. Featuring spectacular wildlife footage capturing the changing seasons, this lyrical documentary transports the viewer to a dazzling world that goes all but unnoticed by the 38 million people who visit America's most famous park each year.

Directed By: Jeffrey Kimball

Genre: Documentary

Release date: Jan 18, 2013 (Limited)
